<!DOCTYPE html>
<title>Labs</title>
<style>
    body {
        display: flex;
        align-content: center;
        align-self: center;
        width: 100vw;
        height: 100vh;
        color: #737373;
        background-color: #f8f9f9;
        background: linear-gradient(120deg, #f8f9f9 60%, #06f 60%);
        text-align: center;
        font-family: sans-serif;
        scroll-behavior: smooth;
        transform: scale(.95);
        transition: all ease-in-out 150ms;
        overflow: hidden
    }

    body:hover {
        transform: scale(.96)
    }

    h1 {
        font-size: 450%
    }

    span {
        display: block;
        background-color: #f8f9f9;
        border: 2px solid #06f;
        border-radius: 5px;
        padding: .6em;
        cursor: pointer;
        color: #06f;
        transition: all ease-in-out 150ms;
        font-size: 105%;
        margin: 0;
        margin: auto;
        margin-bottom: 3%;
        width: 40%
    }

    span:hover {
        background-color: #06f;
        color: #f8f9f9
    }

    h6 {
        width: 60%;
        margin: auto;
        font-weight: 300;
        font-size: 120%
    }

    svg {
        width: 40vw;
        height: auto;
        display: block
    }

    caption {
        margin: auto;
        align-self: center;
        padding: 1em;
        color: #c7c8c8;
        padding-top: 3em
    }

    a,
    a:visited {
        color: #f8f9f9;
        transition: all ease-in-out 150ms;
        text-decoration: none
    }

    a:hover {
        color: #fff5f5
    }

    p {
        font-size: 60%;
        color: #f8f9f9
    }

    #text {
        width: 40%;
        margin: auto
    }

    @media (max-width:900px) {
        #phone {
            display: none
        }

        #text {
            width: 80%
        }

        a,
        a:hover,
        a:visited,
        p {
            color: #737373
        }

        span,
        hr {
            display: block;
            margin: 0;
            width: 60%;
            margin: auto;
            margin-bottom: 5%
        }

        body {
            background: #f8f9f9
        }
    }

    #n,
    i {
        color: #737373
    }

    h2 {
        width: 60%;
        margin: auto;
        text-align: center;
        border-bottom: 1px solid #737373;
        line-height: 0.1em;
        margin-bottom: 1.5em;
    }

    h2 b {
        background: #f8f9f9;
        padding: 0 10px;
        text-decoration: none;
    }
</style>
